import styled from "styled-components";

export const ContactIframe = styled.iframe`
  url(https://docs.google.com/forms/d/e/1FAIpQLScV1lBdUWjz12stzozHYYTdb7Kv3698odggzG9O3QlEDoTsEQ/viewform?embedded=true);
   width="640" height="911;
    frameborder=0;
     marginheight=0;
      marginwidth=0;
  @media screen and (max-width: 800px) {
    padding: 0px;
  }
`;
